import React from 'react';
import {Grid,Paper} from "@material-ui/core";

const Login = () => {

    const paperStyle={padding:10,height:"70vh",width:370,margin:"40px auto"}
    return (
        <Grid>
            <Paper elevation={10} style={paperStyle}>
                Sign In
                </Paper>
        </Grid>
    )
}
export default Login;
